INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (10118, 91002, 8, 2834, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 0, "フリーマーケット会場", "ペコリーヌとの出会い", 7, "青空の下で謁見", 40, 2, 0, 1, 5118061);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (10118, 91002, 8, 2835, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 0, "フリーマーケット会場", "マホとの出会い", 7, "未来の騎空団\nマスコット？", 40, 2, 0, 1, 5118062);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (10118, 91002, 8, 2837, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 0, "ランドソル市街地", "アキノとの出会い", 7, "お嬢さまからの\n緊急依頼", 40, 2, 0, 1, 5118063);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (10118, 91002, 8, 4108402, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 0, "フリーマーケット会場", "ジュンとの出会い", 18, "黄金色の悩みごと", 40, 2, 0, 1, 5118064);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (10118, 91002, 8, 4107402, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 0, "フリーマーケット会場", "カオリとの出会い", 18, "白熱！　格闘大会！", 40, 2, 0, 1, 5118065);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (10118, 91002, 8, 9000227, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 1, "オーエド町", "ニノンとの出会い", 16, "祭り太鼓はオーエドの華", 40, 2, 0, 1, 5118066);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (10118, 91002, 8, 2101181, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 0, "フリーマーケット会場", "スズナとの出会い", 19, "人気者は遅れて\nやってくる", 40, 3, 0, 1, 5118067);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (10118, 91002, 8, 4109402, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 0, "ランドソル市街地", "ナナカとの出会い", 18, "巫女・ミーツ・魔法少女", 40, 3, 0, 1, 5118068);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (10118, 91002, 8, 4305402, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 0, "フリーマーケット会場", "キャル＆コッコロとの出会い", 18, "ネズ耳は二度なくなる", 40, 3, 0, 1, 5118069);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (10118, 91002, 8, 4101402, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 0, "ランドソル市街地", "ユカリとの出会い", 18, "この出会いにカンパイ！", 40, 3, 0, 1, 5118070);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (10118, 91002, 8, 4106402, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 0, "ランドソル市街地", "アオイとの出会い", 18, "陰陽アンサンブル", 40, 3, 0, 1, 5118071);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (10118, 91002, 8, 2836, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 1, "フリーマーケット会場", "シノブとの出会い", 7, "運試し十番勝負！", 40, 3, 0, 1, 5118072);
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (10118, 0, 0, 0, 0, 0, 0, "オープニング", 0, "彼女たちの新たな日常", 0, 1, 10145115, 0, 5118600);
